import React, { Component } from 'react'


export default class downloadSelected extends Component {

    styleSheets = {
        mainContainer : {
            width : "100vw",
            height : "100vh",
            position : "fixed",
            backgroundColor : "rgba(0,0,0,0.2)",
            zIndex : 2
        },
        layoutContainer : {
            width : "60vw",
            height : "50vh",
            position : "absolute",
            margin : "auto",
            inset : 0,
            backgroundColor : "#fff" 
        }
    }




    render() {
        const { mainContainer } = this.styleSheets




    return (
      <div style={mainContainer}>
        <div style={layoutContainer}></div>
      </div>
    )
  }
}
